function generateUUID() {
  return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function(c) {
    var r = Math.random() * 16 | 0,
        v = c == 'x' ? r : (r & 0x3 | 0x8);
    return v.toString(16);
  });
}

const items = [];
items.push({
  json: {
    uuid: generateUUID()
  }
});

return items;

// Get inputs from the workflow
const photos = $('inputs').first().json.originalPhotos;
const propertyId = $input.first().json.id;

// Function to process the photos
function processPhotos(photos, propertyId) {
  // Array to store the processed photo objects
  const processedPhotos = [];

  // Loop through each photo
  photos.forEach(photo => {
    // Get the jpeg sources array for the photo
    const jpegSources = photo.mixedSources.jpeg;

    // Find the image with the highest resolution (width)
    const highestResImage = jpegSources.reduce((highest, current) => {
      return current.width > highest.width ? current : highest;
    }, jpegSources[0]);

    // Create an object with the property ID and the photo URL
    const photoObject = {
      property_id: propertyId,
      photo_url: highestResImage.url
    };

    // Add the object to the array
    processedPhotos.push(photoObject);
  });

  return processedPhotos;
}

// Process the photos and return the result
const result = processPhotos(photos, propertyId);

// Return the array of processed photos
return result;
